INSERT INTO `diaries` VALUES (1,'探索丽江古城与玉龙雪山的绝美风光，感受纳西族文化的独特魅力。古城的小巷中，每一块石板都诉说着历史的故事。',NULL,0,'2025-04-25 17:38:34.000000',245,'云南七日游攻略',1234,1,0,4,1,496,'云南',NULL),(2,'从火锅到串串，从龙抄手到钟水饺，带你吃遍成都的街头巷尾。特别推荐春熙路附近的老字号，味道正宗，价格实惠。',NULL,0,'2025-04-25 17:38:34.000000',189,'成都美食探店',987,2,1,5,1,397.8,'成都',NULL),(3,'沿着318国道，穿越雪山草原，感受最纯净的高原风光。布达拉宫的庄严，纳木错的宁静，都是此生难忘的风景。',NULL,0,'2025-04-25 17:38:34.000000',312,'西藏自驾之旅',1567,3,0,4.5,2,629.5000000000001,'西藏',NULL),(4,'漫步在鼓浪屿的小巷中，感受中西文化的交融。每一栋老建筑都有它的故事，每一处风景都值得细细品味。',NULL,0,'2025-04-25 17:38:34.000000',178,'厦门鼓浪屿游记',876,1,0,0,0,350.4,'厦门',NULL),(5,'从兵马俑到华清池，从大雁塔到钟鼓楼，感受千年古都的历史沉淀。特别推荐夜晚的城墙漫步，别有一番风味。',NULL,0,'2025-04-25 17:38:34.000000',267,'西安古城文化之旅',1345,2,0,3,1,539.8,'西安',NULL),(6,'探索丽江古城与玉龙雪山的绝美风光，感受纳西族文化的独特魅力。古城的小巷中，每一块石板都诉说着历史的故事。',NULL,0,'2025-04-25 17:38:34.000000',245,'云南七日游攻略',1234,1,0,0,0,493.6,'云南',NULL),(7,'从火锅到串串，从龙抄手到钟水饺，带你吃遍成都的街头巷尾。特别推荐春熙路附近的老字号，味道正宗，价格实惠。',NULL,0,'2025-04-25 17:38:34.000000',189,'成都美食探店',987,2,0,5,1,397.8,'成都',NULL),(8,'沿着318国道，穿越雪山草原，感受最纯净的高原风光。布达拉宫的庄严，纳木错的宁静，都是此生难忘的风景。',NULL,0,'2025-04-25 17:38:34.000000',312,'西藏自驾之旅',1567,3,0,0,0,626.8,'西藏',NULL),(9,'漫步在鼓浪屿的小巷中，感受中西文化的交融。每一栋老建筑都有它的故事，每一处风景都值得细细品味。',NULL,0,'2025-04-25 17:38:34.000000',178,'厦门鼓浪屿游记',876,1,0,0,0,350.4,'厦门',NULL),(10,'从兵马俑到华清池，从大雁塔到钟鼓楼，感受千年古都的历史沉淀。特别推荐夜晚的城墙漫步，别有一番风味。',NULL,0,'2025-04-25 17:38:34.000000',267,'西安古城文化之旅',1345,2,0,0,0,538,'西安',NULL),(271,'aa',NULL,0,'2025-05-12 19:36:21.000000',0,'aa',0,1,0,0,0,0,NULL,NULL),(272,'aa',NULL,0,'2025-05-12 19:39:18.000000',0,'aa',0,1,0,0,0,0,NULL,NULL),(273,'aa',NULL,0,'2025-05-12 19:39:39.000000',0,'a',0,1,0,0,0,0,NULL,NULL),(274,'aa',NULL,0,'2025-05-12 19:39:54.000000',0,'a',0,1,0,0,0,0,NULL,NULL),(275,'aa',NULL,0,'2025-05-12 19:43:16.000000',0,'a',0,1,0,0,0,0,NULL,NULL),(276,'1111',NULL,0,'2025-05-12 19:44:47.000000',0,'Test1',0,1,0,0,0,0,NULL,NULL),(277,'2222',NULL,0,'2025-05-12 20:04:21.000000',0,'Test2',0,1,0,0,0,0,'西安',NULL),(278,'吃火锅好吗？好的',NULL,0,'2025-05-12 20:07:55.000000',0,'成都',0,1,1,